import React, { Fragment } from "react";
import BatmanIcon from "./BatmanIcon";

export const Header: React.FC = () => (
  <Fragment>
    <header>
      <h1 className="logo">
        <span>Batman</span>
        <BatmanIcon />
        <span>Movies</span>
      </h1>
    </header>
    <style jsx global>{`
      body {
        margin: 0;
        padding: 0;
        font-family: "Libre Baskerville, serif";
        font-size: 15px;
        background: #c5c4c4;
      }
    `}</style>
  </Fragment>
);

export default Header;
